import React, { useState } from 'react'
import { View,Text } from 'react-native'

export default function Home() {
  const [title,setTitle]=useState()
  const [contant,setcontant]=useState()
  return (
    <View>
      <Text>Welcome</Text>
    </View>
  )
}
